// item-add.component.ts
import { Component } from '@angular/core';
import { ItemService } from '../item.service';

@Component({
  selector: 'app-item-add',
  templateUrl: './item-add.component.html',
  styleUrls: ['./item-add.component.css'],
})
export class ItemAddComponent {
  newItem: any = {
    Lab_Id: null,
    Eva_id: 1,
    Ieva_acto: null,
    Ieva_estado: null,
    Ieva_puntaje: null,
  };

  constructor(private itemService: ItemService) { }

  addItem(): void {
    this.itemService.addItem(this.newItem).subscribe(() => {
      console.log('Item added');
    });
  }
}
<!-- item-add.component.html -->
<h2>Agregar Ítem</h2>
<form>
  <!-- LAB_ID -->
  <label for="labId">LAB_ID:</label>
  <input type="text" id="Lab_Id" [(ngModel)]="newItem.Lab_Id" name="labId" required>

  <!-- EVA_ID -->
  <label for="evaId">EVA_ID:</label>
  <input type="text" id="Eva_Id" [(ngModel)]="newItem.Eva_Id" name="evaId" required>

  <!-- IEVA_ACTO -->
  <label for="ievaActo">IEVA_ACTO:</label>
  <input type="text" id="Ieva_Acto" [(ngModel)]="newItem.Ieva_Acto" name="ievaActo" required>

  <!-- IEVA_ESTADO -->
  <label for="ievaEstado">IEVA_ESTADO:</label>
  <input type="text" id="Ieva_Estado" [(ngModel)]="newItem.Ieva_Estado" name="ievaEstado" required>

  <!-- IEVA_PUNTAJE -->
  <label for="ievaPuntaje">IEVA_PUNTAJE:</label>
  <input type="text" id="Ieva_Puntaje" [(ngModel)]="newItem.Ieva_Puntaje" name="ievaPuntaje" required>

  <button type="button" (click)="addItem()">Agregar</button>
</form>
